public class GenericClass<T>\n{\n    public void Print(T value)\n    {\n        Console.WriteLine(value);\n    }\n}\n\npublic class Program\n{\n    public static void Main(string[] args)\n    {\n        GenericClass<int> intInstance = new GenericClass<int>();\n        intInstance.Print(123); // JIT compiles the generic method for int.\n\n        GenericClass<string> stringInstance = new GenericClass<string>();\n        stringInstance.Print("Hello, World!"); // JIT compiles the generic method for string.\n    }\n}